import React from "react";

function Login() {
  return (
    <div>
      {show == true && (
        <Alert
          serverity="error"
          className="fw-bold"
          style={{ fontSize: "25px" }}
        >
          All fields are required
        </Alert>
      )}
      <Row style={{ width: "100%" }}>
        <Col style={{ width: "50%" }}>
          <FormControl
            sx={{ border: "2px solid rgb(223,223,223)", width: "90%" }}
            className="p-3 my-3 py-5"
          >
            <h1>Login to neostore</h1>
            <TextField
              style={{
                width: "100%",
                border: "1px solid rgb(223,223,223)",
                outline: "none",
              }}
              className="my-4"
              id="outlined-basic"
              variant="outlined"
              placeholder="email"
              name="email"
              onChange={handleLoginData}
              required
              InputProps={{
                endAdornment: (
                  <InputAdornment position="start">
                    <EmailIcon />
                  </InputAdornment>
                ),
              }}
            ></TextField>
          </FormControl>
        </Col>
      </Row>
    </div>
  );
}

export default Login;
